import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { NgxPaginationModule } from 'ngx-pagination';
import { FormsModule } from '@angular/forms';


import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { GroceryProductsListComponent } from './Component/grocery-products-list/grocery-products-list.component';
import { AuthService } from './Component/Services/auth.service';
import { GroceryProductsService } from './Component/Services/grocery-products.service';


import { ReactiveFormsModule } from '@angular/forms';
import { ViewCartListComponent } from './Component/view-cart-list/view-cart-list.component';
import { HttpClientModule } from '@angular/common/http';
import { UserRegisterComponent } from './Component/user-register/user-register.component';
import { LoginComponent } from './Component/login/login.component';
import { HeaderComponent } from './Component/header/header.component';

import { MyOrderListComponent } from './Component/my-order-list/my-order-list.component';
import { AddProductComponent } from './Component/add-product/add-product.component';
import { ProductDetailPageComponent } from './Component/product-detail-page/product-detail-page.component';
import { UpdateProductListComponent } from './Component/update-product-list/update-product-list.component';



@NgModule({
  declarations: [
    AppComponent,
    GroceryProductsListComponent,
    ViewCartListComponent,
    UserRegisterComponent,
    LoginComponent,
    MyOrderListComponent,
    AddProductComponent,
    ProductDetailPageComponent,
    UpdateProductListComponent,
    HeaderComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    ReactiveFormsModule,
    HttpClientModule,
    NgxPaginationModule,
    FormsModule
  ],

  providers: [
    GroceryProductsService,
    AuthService
  ],
  bootstrap: [AppComponent]
})
export class AppModule { }
